import React, { Component } from 'react';
import "./LinkButton.css";



class LinkButton extends Component {
    render() {
        return (
            <>
                <a href={this.props.onClick} className='linkButton'>
                    {this.props.text}
                </a>
            </>
        );
    }
}

export default LinkButton;
